import './Button.scss';
import vector from'../../pages/images/Vector.png'
import { useNavigate } from 'react-router-dom'
import React from 'react';

function Button({nameBtn, classBtn}){  

  const navigate = useNavigate();

  const routerButton = ({target})=>{
    console.log(classBtn)
    if(classBtn === 'buttonBlue'){
      navigate('/initial')
    }else if(classBtn === 'buttonWhite') {
      linkFigma();
    } 
  }

  const linkFigma=()=>{
    return(
      <a href="https://www.figma.com/proto/aGIhglAoUxJYwv9BGWGEPD/Case-front-end?node-id=2%3A1138&scaling=min-zoom&page-id=0%3A1&starting-point-node-id=2%3A1138">Website</a>
    )
  }

    return (
      <>
        <button className={classBtn} onClick={routerButton}><img src={vector} alt="logo KPis"/>{nameBtn}</button>
      </>
    );
  };
  export default Button;
